import React, {useEffect,useState} from 'react'
import axios from 'axios'
import Model from "./Model";
import Navbar from "./Navbar";

const Home =()=>{
    const [data, setdata] = useState([]);
    const [search, setsearch]= useState("");
    
    useEffect(() => {


        const fetchDate= async()=>{
            
               const results = await axios("https://api.giphy.com/v1/gifs/trending",{
                    
                params:{
                    api_key:"z679gymyX1e9pWFLNt1w6mrFusJ2paID"
                }

                });
                console.log(results)
                setdata(results.data.data);
        };
            fetchDate()
    },[]);

   const renderGifs=()=>{
            
            return data.map(el => {
                return(
                <div key={el.id} className='gif'>
                        <img src={el.images.fixed_height.url} />
                </div>
                )
            })
    }

            const handlesearchchange=()=>{
                setsearch(event.target.value);
            }

    return(
        <>
        <Navbar/>
        <Model/>
        <div className="container p-4">
                    <nav className="navbar navbar-expand-lg navbar-light bg-primary">
            <div className="container justify-content-center ">
            
                <form className="d-flex container ">
                    <input value={search} onChange={handlesearchchange} className="form-control " type="search" placeholder="Search" aria-label="Search" />
                    <button className="btn btn-outline-light" type="submit"><i className="fas fa-search"></i></button>
                </form>
                
            </div>
            </nav>
        <h3 ><strong> Tranding GIF's</strong></h3>
            
         <div className="gifs">{renderGifs()}</div>
        
        </div>
                        
               
        </>
    )
}
export default Home;
